syntax = "proto3";



import "PathStatusType.proto";
import "Rotation.proto";

message QueryPathRsp {
	enum PKKNJCEPAHM {
		option allow_alias = true;
		NONE = 0;
		PEPPOHPHJOJ = 2355;
		DCDNILFDFLB = 0;
		NNBKOLMPOEA = 1;
	}

	int32 retcode = 13;
	repeated Rotation corners = 11;
	PathStatusType queryStatus = 6;
	int32 queryId = 15;
}
